import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

export default function SelfService() {
    return (
        <Card style={{ width: '18rem' }}>
          <Card.Body>
            <Card.Title><h2>Self Service</h2></Card.Title>
            <Card.Text>
                <Card.Img variant="top" src="https://c8.alamy.com/comp/G54W1F/people-help-themselves-to-food-at-a-self-service-buffet-at-a-party-G54W1F.jpg" height={300} width={300}/>
          
              <h2>In self-service restaurants, customers order and pay for their food at a 
            counter or kiosk and serve themselves. This type of service is common in 
            fast-food restaurants, cafeterias, and some coffee shops. </h2>
            </Card.Text>
            {/* <Button variant="primary">Go somewhere</Button> */}
          </Card.Body>
        </Card>
      );
}
